Another screening on the books for our beloved film #GoodbyeJulia. Thanks to everyone that came out to @NeueHouse to support! It’s so inspiring to hear everyone’s reactions to this important film. 

After the screening, I had the chance to sit with writer and director, @mohamed_kordofani to delve a little deeper into the film. I signed on to be the executive producer after the film was made, so it was wonderful to hear about the process of making the film, from how he chose the cast to what drove him to tell this story. #GoodbyeJulia is a cinematic gem that will continue to reach the hearts and minds of people all over the world. Have you seen it yet? #FYC #ForYourConsideration

